            _CurrentTab = "Specimen";

        }
        else if (type == "Organism")
        {
            ShowOrganismMappingPopup = control;
            _CurrentTab = "Organism";
        }
        else if (type == "WardType")
        {
            ShowWardTypeMappingPopup = control;
            _CurrentTab = "WardType";
        }
    }




